      "description": "From the cliffs of Pointe-du-Hoc to the hedgerow battles in the Corentin Peninsula and beyond -- Memoir '44 airdrops you into the key battles that turned the tide in Western Europe during the summer of 1944. Omaha Beach, Pegasus Bridge, Operation Cobra... Step in and command your troops on the battlefields that defined History in the 20th century!\r\n<strong>Memoir '44</strong> is a historical game where players command a horde of little plastic Army men facing-off in dozens of WWII battles on an oversize hex game board.\r\nEach battle scenario mimics the historical terrain, troop placements and objectives of each army. Deploying forces through a variety of Command cards, the smart commander uses the unique skills of his units -- infantry, paratroopers, tanks, artillery, commandos and resistance fighters -- to its greatest strength.\r\nEasy to learn and fast-paced, Memoir '44 requires strategic card play, timely dice rolling and an aggressive, yet flexible battle plan to achieve victory!",
