      "description": "The original dice builder RPG! You and up to three other players are Gearlocs. Your homeland has been invaded by seven savage Tyrants, and the Gearloc Council has summoned you to defeat them. Draw daily encounters filled with tough decisions and battles as you make your way to the Tyrant’s lair. Discover powerful Loot and Trove Loot to help you on your way. Build your character and unlock new dice to roll as you take down unique Baddies, each with their own special abilities and traits.\r\nLoaded with content for solo and coop play, Too Many Bones comes with 136 custom dice, beautiful edge-stitched neoprene mats, PVC cards and dozens of high-quality chips. The seven Tyrants employ their own special encounters and a unique final battle that will put all your skills to the test. Each of the four Gearlocs come with 21 custom dice, numerous character build options and completely unique gameplay mechanics and skills. This a game you’ll bring back to the table to try something new again and again.",
