      "description_preview": " An underwater volcano has erupted and the island of Atlantis is sinking into the sea! Unless the people of Atlantis escape before the volcano explodes, all the inhabitants are doomed! In this game you try to lead your people from the sinking central island of Atlantis to the safety of one of four islands nearby. Your people can get there by boat (if they find one) or by swimming but avoid the Sea Serpents, Whales, and Sharks! The player with the most survivor points wins.    Survive  is a cutthroat game where players seek to evacuate their pieces from an island that is breaking up, while remembering where their highest-valued pieces are located to maximize their score.   An island made up of 40 hex-tiles is slowly sinking into the ocean (as the tiles are removed from the board). Each player controls ten people (valued from 1 to 6) that they try and move towards the safety of the surrounding islands before the main island finally blows up. Players can either swim or use boats to travel but must avoid sea serpents, whales and sharks on their way to safety.   Survive is very similar to Escape from Atlantis with some key differences. "
