      "description": "Build your own Path without your opponents steering you in the wrong direction-or off the board! Tsuro is the quick-playing game in which directions can change as easily as the game plays. The rules are simple: You place your stones, select your tiles, and attempt to build a safe Path for your journey. The Paths of other players cross and connect, so the choices you make affect all the journeys across the board. Stay on the right Path-your journey begins here.\r\nThe game consists of tiles with twisting lines on them, a 6x6 grid on which to lay these tiles and a token for each player. Each player has a hand of tiles. On your turn you do two things: place a tile from your hand onto the board next to your token and move your token as far as it can go along the line it is currently on, until it is stopped by an empty space with no tile in (yet), the edge of the board or colliding with another player's token. If your token reaches the edge of the board or collides with another player's token, you are out of the game. The aim of the game is to be the last player left with a token on the board. Strategy therefore consists of trying to drive your opponents either into each other or off the board whilst extending your own route in directions that will make it difficult for your opponents to do the same.",
