      "description_preview": " Greetings, mortal! You have ascended into the divine realms, and here, among the celestial islands, your mettle shall be tested with the utmost rigor. Only the mightiest heroes shall pass all challenges and craft their own destiny, rising to become a demigod. Make your own luck with Dice Forge, a game of crafting dice and heroic deeds for two to four players!  Dice Forge is a board game from Libellud that challenges you to harness your powers and challenge up to three other players in a battle for dominance. During the game, your dice provide the resources you need, but throughout the game, you'll change your dice, snapping new faces on and improving your chances of claiming victory. When the gods call an end to your contest, the player with the most glory wins the game. "
