      "description_preview": " Ancient Egypt is overflowing with opportunity and as a royal advisor, you are tasked with enriching its society through art, religion, astronomy, writing, and agriculture. Gain the favor of the gods to build incredible monuments, advance your civilization, and collect piles of gold. Incur their wrath, however, and a disaster may upset your royal efforts. Battle for glory and push your luck in Ra, a game of high-stakes bidding and divine intervention. \r\n  Ra  is an auction and set-collection game with an  Ancient Egyptian  theme. Each turn players are able to purchase lots of tiles with their bidding tiles (suns). Once a player has used up his or her suns, the other players continue until they do likewise, which may set up a situation with a single uncontested player bidding on tiles before the end of the round occurs. Tension builds because the round may end before all players have had a chance to win their three lots for the epoch. The various tiles either give immediate points, prevent negative points for not having certain types at the end of the round (epoch), or give points after the final round. The game lasts for three \"epochs\" (rounds). "
