      "description": "Paperback is a card game where players create words using individual letters. Gameplay is for 2-5 players and typically takes 45 minutes. To play, you score words in order to buy better letters with cool abilities. But scoring won't win the game - you must finish novels to make it as a paperback writer!\r\n<strong>Game Contents</strong>\r\n<ul>\r\n<li>Sturdy Two-Piece Box</li>\r\n<li>200+ Grey-Core Linen-Finish Cards</li>\r\n<li>Full Color Instructions</li>\r\n<li>Wooden Counters</li>\r\n<li>Dividers for Organizing</li>\r\n</ul>\r\n<strong>Product Reviews</strong>\r\n&quot;I love word games and I love deck builders - now I can get both in one game! Paperback is a blast to play, and much easier to get into for my less geeky friends than many of the other fantasy-themed deck building games.&quot; <strong>-Jeff Cannata of the Totally Rad Show</strong>\r\n&quot;Paperback is a terrific game for just about anyone. Serious gamers can geek out on the clever use of deckbuilding mechanisms in a classic word game. Casual players can enjoy the easy gameplay and creativity they express in their word choices each turn. Families can delight in the well-disguised educational value and very obvious fun Paperback provides. Our family and friends have had a great time playing Paperback and I know you will, too.&quot; <strong>-Eric R. Burgess of Boardgame Babylon</strong>",
