      "description": "The evil Lord Eradikus has all but conquered the galaxy, and is now on a victory lap across the sector in his flagship, Eradikus Prime. He may rule with an iron grip, but his most prized artifacts are about to slip through his cyborg claws. You and your fellow thieves have challenged each other to sneak aboard his ship, hack your way into its command module, and steal from him. Along the way, you'll recruit allies and snatch up extra loot. But one false step and-Clank! Careless noise draws the attention of Lord Eradikus. Hacking into his command module and stealing his artifacts increases his rage. You'd better hope your friends are louder than you are if you want to make it to an escape pod and get out alive... <br />\r\n<br />\r\n<b>Contains:</b><br />\r\n* 7 Game Board Pieces <br />\r\n* 43 Reserve Cards: 15 FAZR, 15 Boldly Go, 12 Memory Core, 1 GOB-L1N <br />\r\n* 4 Starting Decks (10 cards each) <br />\r\n* 100 Adventure Deck Cards <br />\r\n* 6 Artifacts <br />\r\n* 11 Major Secrets <br />\r\n* 28 Minor Secrets <br />\r\n* 120 Clank Cubes (30 of each player color) <br />\r\n* 1 Boss Marker <br />\r\n* 24 Boss Cubes <br />\r\n* 4 Bounty Hunter Cubes <br />\r\n* 8 Market Items: 2 Master Key, 2 TelePass, 2 Med Kit, 2 Contraband <br />\r\n* 1 Market Board <br />\r\n* 1 Blockade Token <br />\r\n* 4 Command Code Tokens <br />\r\n* 5 Power Crystals <br />\r\n* 8 Data Cubes (2 of each player color) <br />\r\n* 4 Unique Player Pawns <br />\r\n* 1 Boss Bag",
