      "description_preview": "The evil Lord Eradikus has all but conquered the galaxy, and is now on a victory lap across the sector in his flagship, Eradikus Prime. He may rule with an iron grip, but his most prized artifacts are about to slip through his cyborg claws. You and your fellow thieves have challenged each other to sneak aboard his ship, hack your way into its command module, and steal from him. Along the way, you'll recruit allies and snatch up extra loot. But one false step and-Clank! Careless noise draws the attention of Lord Eradikus. Hacking into his command module and stealing his artifacts increases his rage. You'd better hope your friends are louder than you are if you want to make it to an escape pod and get out alive...  \r\n \r\n Contains:  \r\n* 7 Game Board Pieces  \r\n* 43 Reserve Cards: 15 FAZR, 15 Boldly Go, 12 Memory Core, 1 GOB-L1N  \r\n* 4 Starting Decks (10 cards each)  \r\n* 100 Adventure Deck Cards  \r\n* 6 Artifacts  \r\n* 11 Major Secrets  \r\n* 28 Minor Secrets  \r\n* 120 Clank Cubes (30 of each player color)  \r\n* 1 Boss Marker  \r\n* 24 Boss Cubes  \r\n* 4 Bounty Hunter Cubes  \r\n* 8 Market Items: 2 Master Key, 2 TelePass, 2 Med Kit, 2 Contraband  \r\n* 1 Market Board  \r\n* 1 Blockade Token  \r\n* 4 Command Code Tokens  \r\n* 5 Power Crystals  \r\n* 8 Data Cubes (2 of each player color)  \r\n* 4 Unique Player Pawns  \r\n* 1 Boss Bag"
