      "description": "<em><strong>Nemesis</strong></em> is a 1-5 player survival sci-fi game where players are woken up from hibernation as a crew of a space ship. The emergency procedure states that there is a critical system failure and the space ship can't continue its cruise. The goal of the crew is to find what is causing this failure and fix the situation to safely return back to Earth. The main problem is that one crew member is dead. Somebody crashed his hibernation chamber and pulled his body out. In addition, if you listen closely, some additional noises and sounds can be heard. New ones, strange ones, ones that were never heard before…\r\n<em><strong>Nemesis</strong></em> is a cooperation game combined with bluffing, backstabbing, and other elements of a science-fiction survival horror adventure.",
      "commentary": "",
      "faq": "<h4>Frequently Asked Questions</h4>\r\n<strong>How do you play this game?</strong>\r\nNemesis is a relatively complex game. If you prefer learning how to play the game through a video rather than reading the rulebook, here's a comprehensive guide put together by <a href=\"https://www.youtube.com/channel/UCYIoVaU55eFUmwgztqvuF2w\">Board Game Replay</a>:\r\n<div>\r\n<div class=\"d-block d-sm-none\"><iframe src=\"https://www.youtube.com/embed/g1NnAHptaeE\" width=\"300\" height=\"170\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" data-mce-fragment=\"1\"></iframe></div>\r\n<div class=\"d-none d-sm-block\"><iframe src=\"https://www.youtube.com/embed/g1NnAHptaeE\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" data-mce-fragment=\"1\"></iframe></div>\r\n</div>\r\n<strong>Can you play this solo? Is it good?</strong>\r\nThe official rulebook includes a solo mode. While it loses out on the semi-cooperative nature of the standard game, the thematic gameplay still delivers a compelling experience. It ranked #91 on <a href=\"/forum/fB13KeWhj7/top-100-solo-games-according-to-1-player-guild\">2020 People's Choice Top 200 Solo Games</a> after jumping 106 positions. This annual award gives a great pulse on the hottest games in the solo community.\r\n<img class=\"w-50\" src=\"https://d2k4q26owzy373.cloudfront.net/700x700/games/userfiles/1614849148783-nemesis%20solo%20rules.png\" alt=\"\" />\r\n<strong>What's inside the box?</strong>\r\n<ul>\r\n<li>1 Two-sided Board</li>\r\n<li>6 Character Boards</li>\r\n<li>11 Room Tiles \"1\"</li>\r\n<li>9 Room Tiles \"2\"</li>\r\n<li>1 Scanner, 1 Intruder Board, 1 Intruder Bag</li>\r\n<li>2 d6 Attack Dice and 2 d10 Noise Dice</li>\r\n<li>Miniatures\r\n<ul>\r\n<li>6 Characters</li>\r\n<li>6 Larvae</li>\r\n<li>3 Creepers</li>\r\n<li>8 Adult Intruders</li>\r\n<li>2 Breeders</li>\r\n<li>1 Queen</li>\r\n</ul>\r\n</li>\r\n<li>5 Plastic Card Holders, 6 Colored Plastic Rings</li>\r\n<li>2 Room Sheets</li>\r\n<li>Markers and Tokens\r\n<ul>\r\n<li>18 Status Markers</li>\r\n<li>50 Ammo/Injury Markers</li>\r\n<li>30 Noise Markers</li>\r\n<li>8 Fire Markers</li>\r\n<li>12 Doors</li>\r\n<li>8 Malfunction Markers</li>\r\n<li>6 Engine Tokens (3 Working, 3 Damaged)</li>\r\n<li>2 Five Injury Tokens</li>\r\n<li>4 Escape Pods</li>\r\n<li>8 Intruder Egg Tokens</li>\r\n<li>20 Exploration Tokens</li>\r\n<li>27 Intruder Tokens</li>\r\n<li>1 Blue and 5 Red Character Corpse Tokens</li>\r\n<li>8 Intruder Carcass Tokens</li>\r\n<li>1 First Player Token</li>\r\n<li>1 Airlock Procedure Token</li>\r\n</ul>\r\n</li>\r\n<li>Cards\r\n<ul>\r\n<li>60 Action Cards (10 per Character)</li>\r\n<li>18 Objective Cards (9 Personal and 9 Corporate)</li>\r\n<li>27 Contamination Cards</li>\r\n<li>20 Intruder Attack Cards</li>\r\n<li>16 Serious Wound Cards</li>\r\n<li>20 Event Cards</li>\r\n<li>5 Help Cards</li>\r\n<li>8 Intruder Weakness Cards</li>\r\n<li>8 Coordinates Cards</li>\r\n<li>30 Green (Medical) Item Cards</li>\r\n<li>30 Yellow (Technical) Item Cards</li>\r\n<li>30 Red (Military) Item Cards</li>\r\n<li>12 Blue (Crafted) Item Cards</li>\r\n<li>6 Character Starting Item Cards (Weapon)</li>\r\n<li>12 Character Quest Item Cards)</li>\r\n<li>6 Character Draft Cards</li>\r\n</ul>\r\n</li>\r\n<li>Advanced Mode Components\r\n<ul>\r\n<li>7 Solo/Coop Objective Cards</li>\r\n<li>10 Intruder Action Cards</li>\r\n</ul>\r\n</li>\r\n</ul>",
