      "description": "<div>\r\n<strong>Win the favor of the Geisha!</strong><br />Hanamikoji is a simple, yet deep game of careful consideration for two players. Each player takes the role of a restaurateur, attempting to curry the favor of the beloved geisha. Can you sequence your plays in thoughtful reflection to outmaneuver your opponent.? Find out in <em>Hanamikoji</em>!<br /><br /><strong>Play Your Cards Right</strong><br />Gameplay is focused around the geisha, and the use of cards representing instruments of entertainment to sway them to your establishment. Playing the majority of a color's cards in a round will draw the matching geisha to your restaurant. However, each of your offerings must be planned in advance, as you can only present the geisha with gifts based on what offering tiles you have available.\r\n<br />At the start of a player's turn, they draw a card from the deck and decide which of the four offerings to perform. Each player begins the round with the same four offering tiles available, and each tile must be used exactly once during the round to play or discard cards in certain patterns.\r\n<br />Once each player has performed all four of their actions, the Victory Markers on each Geisha are moved toward whoever curried the most favor with the Geisha that round. If the two players tied on how much favor they curried, then the Victory Marker stays put. If at the end of a round a player has earned the favor of four Geisha or Geisha whose points total 11 or more, then that player wins the game!\r\n</div>",
