      "description": "<strong>2nd Edition, 3rd Printing</strong><br /><br />90,000 B.C. - A great Ice Age is fast approaching. Another titanic struggle for global supremacy has unwittingly commenced between the varying animal species.<br /><br />Dominant Species is a game for 2 to 6 players that abstractly recreates a tiny portion of ancient history: the ponderous encroachment of an Ice Age and what that entails for the living creatures trying to adapt to the slowly-changing Earth.<br />Each player will assume the role of one of six major Animal groups-Mammal, Reptile, Bird, Amphibian, Arachnid or Insect. Each begins the game in a state of natural balance with regards to one another. But that won't last: It is indeed ''survival of the fittest.''<br /><br />Through wily Action Pawn placement, players will strive to become Dominant on as many different Terrain tiles as possible in order to draw beneficial Dominance Cards. Players will also want to propagate their individual Species in order to earn Victory Points for his particular Animal. Players will be aided in these endeavors via Growth, Migration and Domination actions, among others.<br /><br />All of this eventually leads to the end game - the final ascent of the Ice Age - where the player with the most Victory Points will have his Animal crowned the Dominant Species.<br /><br />But somebody better become dominant quickly, because it's getting mighty cold....",
