      "description": "Walk a mile in the shoes of a spy! Or was it a kilometer in clogs?<br /><br />SPYFALL is an easy-to-learn card game of bluffing, probing questions, clever answers, and suspicion. At the start of each round, players receive a secret card letting them know where they are - a casino, space station, pirate ship, circus, (30 unique locations!) - except that one player receives the SPY card instead of the location. The Spy doesn't know where he is, but wins the round if he can figure it out before he blows his cover!<br /><br />Players then start asking each other questions during the intense 8-minute rounds. Non-Spy players want to ask questions and give answers that prove to the other players that they know where they are. But watch out! If your questions and answers are too specific, the Spy will easily guess the location and win, so you need to practice a bit of subtlety. But if your questions and answers are too generic, you might be accused of being the Spy. The Spy will also sometimes be asked questions (just like any other player would) and have to come up with questions of his own, without knowing anything about where he is! If you listened carefully to the other players, you'll be able to come up with a plausible question or answer... hopefully.<br /><br />Once per round, each player may accuse another player of being the Spy. If all players agree, the game ends and that player's secret card is flipped up. If the Spy is captured, each of the Non-Spy players win the round. If a Non-Spy is revealed, the Spy wins. Finally, if the Spy figures out where he is, he can reveal his card and make a guess. If he's right, he wins the round. If not, the Non-Spy players win.<br /><br />The game is played over a series of rounds and points are awarded each round. A complete game is typically five rounds and the cards are randomly dealt each round. You could even be the Spy two rounds in a row! After the last round, the player with the most points is the winner.",
