      "description_preview": " Go down in the dungeon. Kill everything you meet.  Backstab your friends and steal their stuff. Grab the treasure and run.  Admit it. You love it.   Munchkin  is the mega-hit card game about dungeon adventure . . . with none of that roleplaying stuff. You and your friends compete to kill monsters and grab magic items. And what magic items! Don the Horny Helmet and the Boots of Butt-Kicking. Wield the Staff of Napalm . . . or maybe the Chainsaw of Bloody Dismemberment. Start by slaughtering the Potted Plant and the Drooling Slime, and work your way up to the Plutonium Dragon . . .  And it's illustrated by John Kovalic!  Fast-playing and silly, Munchkin can reduce any roleplaying group to hysteria. And, while they're laughing, you can steal their stuff. \r\n The Deluxe Edition has a big gameboard to keep your cards in place, and twelve player standies with plastic stands that you move on the gameboard as you level up! "
