      "description": "71 Years Ago: The plague came out of nowhere and ravaged the world. Fever, cough, sores, and death - once infected, most died within a week. Nothing could stop it. The world did its best. It wasn't good enough.\r\nThe last fragments of our people have desperately kept the world from collapsing completely. For three generations we have lived on the seas, on floating stations they called &quot;havens.&quot; Far from the plague, we are able to provide supplies to the mainland - antibiotics, food, medicine, and tools - to keep them (and us) from succumbing completely. We keep a network of the largest known cities in the world alive. Things have been tough the past few years. Cities far away from the havens have fallen off the grid. We don't know what's happened to them. We don't know why the supplies aren't reaching them. We have only a few cities left on our gird. We are failing.\r\nA cooperative legacy game for two to four players, <strong>Pandemic Legacy: Season 2</strong> immerses players in a harrowing tale of survival. It is seventy-one years after the events of Pandemic Legacy: Season 1, and humanity has been brought to its knees. A network of the last known cities persists, supplied by the havens, isolated stations floating in the ocean far from the plague. Three generations of survivors have called the havens home. Most of them have never set foot on the mainland. But now supplies are running low and the people have turned to you to lead. It's up to you to save what remaining cities you can and stop the world from ending for good.",
