      "max_playtime": 90,
      "min_age": 12,
      "description": "<strong>Overview</strong>\r\nBurgle Bros is a cooperative boardgame where you assemble a crew, make a plan, and pull off the impossible heist! Gameplay is for 1 - 4 players and typically lasts for 45 - 90 minutes. To play, you must make your way past the alarms and guards, find the stash and get to the roof to escape. But be careful - if anyone on your crew gets caught, it's all over.\r\n<strong>Game Contents</strong>&lt; /br&gt; - 124 Premium Square Cards, 48 Cardboard Tiles&lt; /br&gt; - 9 Character Meeples, 3 Guard Meeples&lt; /br&gt; - 9 Translucent Dice&lt; /br&gt; - 73 Tokens&lt; /br&gt; - 24 Wood Walls&lt; /br&gt; - Colored Instructions&lt; /br&gt;&lt; /br&gt; <strong>Product Reviews</strong>\r\n&quot;Finally, a heist movie that fits on your tabletop!&quot; - <strong>Raph Koster</strong>\r\n&quot;Burgle Bros is an intense co-op game with great replay value. It's very thematic, easy to learn and moves quick. You'll love how the tension ramps up as the game progresses.&quot; - <strong>Reza Lackey</strong>\r\n&quot;Don't let the kiddie title fool you, Burgle Bros is an intensely strategic game filled with fun, highly thematic moments. Have you ever wanted to pull off a huge heist? This is the closest you'll get without breaking the law.&quot; - <strong>Peter Sciretta</strong>\r\n&quot;It's a light-ish co-op where you feel your world closing in, and like there's NO WAY you can get out unseen by the guards. Great tension, and I'm guessing great relief if you can get out in time. I wouldn't know, since the guards spotted us. But NEXT TIME...!&quot; - <strong>Rich Sommer</strong>\r\n&quot;I enjoyed the game and it felt like my decisions mattered. I like the way the game makes you do real co-op, having to coordinate your actions nearly all of the time. You definitely can't just daydream during other player's turns.&quot; - <strong>Darron Shaffer</strong>",
