      "description": "Your pulse races as diamond fever rises. No wonder: the adventurers delve into the cave, which is sparkling with diamonds, and try to bring our as many jewels as possible. But uncanny dangers and malicious researchers play an evil game in the cave. Now you must flee or risk everything in order to win with the largest treasure.\r\n<strong>Diamant</strong> (also published as <strong>Incan Gold</strong>) is a quick, fun game of bluff and daring in which explorers push their luck while exploring in search of gold and treasure. In each round, you decide whether to delve deeper into the temple, adding to your riches, or escape with the share you've acquired so far. Every time an explorer braves new territory, more gems and dangers appear. Giant spiders, mummies and fire can cause you to lose everything. Is it worth the risk? You decide. But if you leave, those who remain in the temple may acquire a bigger share of each stash of jewels yet to be found.\r\n<strong>Incan Gold:</strong>\r\nYou and your fellow adventurers explore the ruins of an ancient Incan temple, looking for turquoise, obsidian, and gold. At every turn, you must decide whether to play it safe by returning to camp with the treasure you've gathered so far; or to be a truly intrepid adventurer and keep on exploring.\r\nGoing farther into the ruins means risking your treasure by falling victim to giant spiders, wandering mummies, fire spouts, and venomous snakes! But priceless Incan artifacts are rumored to exist here...and you can be the one to discover them if you conquer your fears and forge ahead!",
