      "description": "<em><strong>Ticket to Ride Map Collection: Volume 5 – United Kingdom &amp; Pennsylvania</strong></em> contains a double-sided game board with new rules for use with <em>Ticket to Ride</em> or <em>Ticket to Ride: Europe</em> with players now creating train lines in the British Isles and in Pennsylvania.\r\nThe <strong>Pennsylvania</strong> half of this map collection adds a share mechanism to the basic <em>TtR</em> game. Each time that a player completes a route, they claim a share of one of the companies depicted next to that route. At the end of the game, whoever holds more shares of a company than all other players receives points as a reward.\r\nThe <strong>United Kingdom</strong> half of this map collection introduces the concept of technology to <em>TtR</em>. At the start of the game, players can build only one- and two-train routes and only in England. By spending wild cards, players gain the ability to build routes three trains long or longer, in addition to being able to build ferries across water and build train routes in Scotland, Wales and Ireland. Players can also buy bonus cards that allow them to score extra points for taking certain actions during play. Despite the name, the map covers both the UK and the Republic of Ireland, that is, the islands of Great Britain and Ireland.\r\nAlthough officially an expansion for Ticket to Ride or Ticket to Ride: Europe, this could be used for Ticket to Ride: Nordic Countries. However use with Nordic Countries would be limited to three players and use of spare trains. The UK map requires 35 trains, the Pennsylvania map requires 45 trains, and Nordic Countries contains 40 of each colour (with 5 spare).",
