      "description_preview": " Stake your claim and protect your territory with the Blokus game! It takes less than a minute to learn, but offers endless strategy and fun challenges for the whole family. Each player gets a set of 21 pieces – in red, blue, green, or yellow – then takes turns placing them on the board. There’s just one rule: each piece you play must touch at least one other piece of the same color, but only at the corners! The goal is to fit the most pieces on the board. The game ends when no more pieces can be placed down, and the player with the lowest number remaining wins! "
