      "description_preview": " A little mandrake root, a little raven's feather. Toss them in the cauldron and see what they make. Should you drink it? Maybe not. After all, that's what students are for.  Welcome to the world of Alchemists! Perform experiments to discover the magical properties of your ingredients. Demonstrate your knowledge by selling potions. Use the money to buy artifacts that further your research. Publish, publish, publish! Earn grants. And expose the fallacies published by those fools who think they can be your rivals.  Alchemists is a game of strategy, risk assessment, and deduction. Do you experiment to get more knowledge or do you publish now to get more points? Pay to endorse the latest theory of toads or save your money for an artifact? And should you really be selling that potion to the large axe-wielding barbarian when you aren't quite sure of its effects? The choices you make will prove whether you are the world's greatest alchemist.  This game is designed to be played using an app that turns your tablet or smartphone into an ingredient card reader. The app is available for free. Supported operating systems are: iOS, Android, Windows. If, for whatever reason, you don't want to use the mobile app, you can still use the web-based version or play with one player acting as the game master. "
