      "description_preview": " While empires rise and fall in Eastern Europa, the rest of the world takes notice. Two distant factions, Albion and Togawa, send emissaries to scout the land and employ their own distinct styles of conquering.  This expansion to Scythe adds 2 new factions, each with 5 miniatures, 31 custom wooden tokens, and 1 faction mat. It also includes new cardboard tokens, 2 new player mats, 6 Automa cards, and a custom plastic insert designed to fit into the expansion box or the original Scythe box. The expansion works seamlessly with any version of Scythe.  The originally game was capped at 5 players, but with 2 new player mats in the expansion 6-7 player games can be played. To scale up, the expansion includes alternate abilities for some of the original factions. "
