      "description_preview": " The forces of evil are threatening to overrun Hogwarts castle in this new cooperative game! It is up to four students to ensure the safety of the school by defeating villains and consolidating their defenses. Players take on the role of a Hogwarts student: Harry, Ron, Hermione or Neville, each with his or her own personal deck of cards.   To secure the castle from the forces of evil the students must work together to build more powerful decks using iconic Wizarding World characters, spells, and items. Defeat all the villains including He-Who-Must-Not-Be-Named and win the game! \r\n By gaining influence, players add more cards to their deck in the form of iconic characters, spells, and magical items. Other cards allow them to regain health or fight against villains, keeping them from gaining power. The villains set back players with their attacks and Dark Arts. Only by working together will players be able to defeat all of the villains, securing the castle from the forces of evil. "
