      "description": "<strong>Third edition:</strong>\r\nThe most notorious vampire of all rises again in the third edition of Fury of Dracula, a board game of deduction and gothic horror based on Bram Stoker's classic novel. One player takes control of the legendary Count Dracula as he stealthily crosses Victorian-era Europe, spreading his diabolical vampirism everywhere he goes. Up to four other players govern Mina Harker and her determined companions as they try to locate and destroy the fiendish Count before he plunges Europe into horrific darkness. But in this heated game of cat and mouse, the hunted prey may also be preying on his hunters. Any day's travel might bring the hunters to Dracula's location. On any night the Count may attack.\r\nThis edition features all-new art and graphic design crafted to complement the game's intuitive, thematic mechanics. Rounds are now broken into day and night: hunters take actions during both, but Dracula can only act at night. Combat is now more streamlined and decisive, and new rumor tokens allow Dracula to mislead hunters and extend the terrible reach of his influence. Count Dracula triumphs if he advances his influence track to thirteen; if the hunters can defeat him before then, they save the continent of Europe and win the game.\r\n<strong>Fourth edition:</strong>\r\nThe fourth edition of <em>Fury of Dracula</em> contains pre-painted miniatures instead of unpainted figures.",
